export function generateItinerary(days, places) {
  let itinerary = [];
  for (let i = 0; i < days; i++) {
    itinerary.push({
      day: i + 1,
      places: places.slice(i * 2, i * 2 + 2)
    });
  }
  return itinerary;
}
